import React, { useState } from 'react';
import './Signup.css'; // Make sure to create a corresponding CSS file

const Signup = () => {
  const [user, setUser] = useState({
    fullName: '',
    email: '',
    username: '',
    password: '',
    confirmPassword: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement your form submission logic here
    console.log(user);
  };

  return (
    <div className="signup-container">
      <div className="signup-logo-section">
        <h1>flex<span className="logo-x">X</span></h1>
        <p>Your personal gym assistant</p>
      </div>
      <div className="signup-form-section">
        <h2>Sign up</h2>
        <p>Join FlexFitness to get started</p>
        <form onSubmit={handleSubmit}>
          <input 
            type="text" 
            name="fullName" 
            placeholder="Your full name" 
            value={user.fullName} 
            onChange={handleChange} 
          />
          <input 
            type="email" 
            name="email" 
            placeholder="Enter your email address" 
            value={user.email} 
            onChange={handleChange} 
          />
          <input 
            type="text" 
            name="username" 
            placeholder="Create a username" 
            value={user.username} 
            onChange={handleChange} 
          />
          <input 
            type="password" 
            name="password" 
            placeholder="Create a strong password" 
            value={user.password} 
            onChange={handleChange} 
          />
          <input 
            type="password" 
            name="confirmPassword" 
            placeholder="Confirm your password" 
            value={user.confirmPassword} 
            onChange={handleChange} 
          />
          <div className="terms">
            <input type="checkbox" id="agree" />
            <label htmlFor="agree">By signing up, you agree to our Terms and Privacy Policy.</label>
          </div>
          <button type="submit">Sign up</button>
        </form>
        <div className="signin-redirect">
          Already have an account? <a href="/login">Log in</a>
        </div>
      </div>
    </div>
  );
};

export default Signup;
